A nova denominação do evento 222 é “Enquadramento / Reenquadramento / Desenquadramento de ME/EPP”;

Selecionar o enquadramento de porte da empresa (ME, EPP, Demais) de acordo com a expectativa de Receita Bruta Anual.

O porte informado deve estar compatível com a Receita Bruta auferida no anocalendário anterior. Assim, durante a prática do evento 222, caso seja solicitado reenquadramento como ME ou EPP, para período que já possua informação de porte atualizada pela RFB com resultado diferente do informado na aplicativo de coleta, a solicitação será indeferida.

A data do evento é a data do registro da Declaração de Enquadramento / Reenquadramento / Desenquadramento no Órgão de Registro, conforme Tabela VIII;

O evento 222 somente poderá ser praticado por estabelecimento matriz;

Somente as naturezas jurídicas 206-2, 207-0, 208-9, 213-5, 223-2, 224-0, 225-9, 226-7, 230-5 e 231-3 exigem o enquadramento de Porte da Empresa. Para estas naturezas jurídicas, o porte pode ser “ME” ou “EPP”. Para o restante das naturezas jurídicas, o porte deve ser “Demais”.

Para análise e deferimento do evento 222, será exigido que o contribuinte apresente a “Declaração de Enquadramento / Reenquadramento ou Desenquadramento”, registrada pelo Órgão de Registro. Caso a referida declaração não seja recente, também deverá ser exigida a Certidão Simplificada do Órgão de Registro, com o objetivo de comprovar o enquadramento atual da empresa naquele órgão.

CAPÍTULO III
DA SITUAÇÃO CADASTRAL SUSPENSA

Art. 36. A inscrição no CNPJ é enquadrada na situação cadastral suspensa quando, conforme o caso, a entidade ou o estabelecimento filial:

I - domiciliada no exterior, encontrando-se na situação cadastral ativa, deixar de ser alcançada, temporariamente, pelas situações previstas no inciso XV do art. 4º;

II - solicitar baixa de sua inscrição no CNPJ, enquanto a solicitação estiver em análise ou caso seja indeferida;

III - for intimada na forma prevista no § 1º do art. 29;

IV - for intimada na forma prevista no § 1º do art. 40;

V - apresentar indício de interposição fraudulenta de sócio ou titular, na situação prevista no § 2º do art. 3º do Decreto nº 3.724, de 10 de janeiro de 2001, enquanto o respectivo processo estiver em análise;

VI - interromper temporariamente suas atividades;

VII - não reconstituir, no prazo de 210 (duzentos e dez) dias, a pluralidade de sócios do seu QSA;

VIII - tiver sua suspensão determinada por ordem judicial; ou

IX - possuir inconsistência(s) em seus dados cadastrais.

§ 1º A suspensão da inscrição no CNPJ nas hipóteses previstas nos incisos I e VI do caput ocorre por solicitação da entidade ou do estabelecimento filial, conforme o caso, mediante comunicação da interrupção temporária de suas atividades, na forma prevista nos arts. 12 a 14.

§ 2º A inconsistência cadastral a que se refere o inciso IX do caput caracteriza-se, conforme o caso, pela:

I - ausência do representante a que se refere o art. 7º ou quando sua inscrição no CPF for inexistente ou estiver cancelada ou nula;

II - ausência do QSA, no caso das entidades relacionadas no Anexo VI desta Instrução Normativa;

III - ausência do ente federativo responsável, no caso de entidades da Administração Pública;

IV - ausência da atividade econômica;

V - ausência ou invalidade do Código de Endereçamento Postal (CEP);

VI - ausência do valor do capital social, para as entidades cuja informação é obrigatória; ou

VII - incompatibilidade entre o Número de Inscrição no Registro de Empresa (Nire) e a natureza jurídica da entidade.

