Cadastral status is the information that reflects in the CNPJ the registration condition of the entity's registration. The registration situations, before the CNPJ, fall into:

• Active;
• Downloaded;
• Suspended;
• Canceled;
• Suspended from Office;
• Discharge process;
• Suspension process;
• Low of Office;

Situação cadastral é a informação que espelha no CNPJ a condição cadastral da inscrição da entidade. As situações cadastrais, perante o CNPJ, enquadram-se em:

• Ativo;
• Baixa;
• Baixa de Ofício;
• Cancelado;
• Em Processo de Suspensão;
• Processo de Baixa;
• Suspenso;
• Suspenso de Ofício;
